import Nav from '../components/Nav'


const Home = () => {

    const authToken = true;

    const handleClick = () => {
        console.log('clicked')
    }




    return (
        <div>

            <Nav></Nav>
            <div className="home">
                <h1>Swipe Right</h1>
                <button className="primary-button" onClick={handleClick}>
                    {authToken ? 'Signout' : 'Create Account'}
                </button>


            </div>
        </div>
    )
}

export default Home;
